var records = Java.from(response_body.records);
var updated = records.map(function(user) {
	var emails = Java.from(user.email);
	if (emails !== null) {
	  var primaryEmail = emails.filter(function(email) {
	  if (email !== null){
		return email.primary_address === true;
	  }
	  });
	  if (primaryEmail.length === 1) {
	 	user.primary_email = primaryEmail[0].email_address;
	  }
	}
	return user;
});
